   "source": [
    "w = rnorm(500,0,1)\n",
    "# 500 N(0,1) variates\n",
    "# takes input vector, sides for convolutions, sides = 1 only lagging values, sides = 2, symmetric, but then need odd filter vector\n",
    "v = filter(w, sides=2, filter=rep(1/3,3))\n",
    "# moving average\n",
    "par(mfrow=c(2,1))\n",
    "plot.ts(w, main=\"white noise\")\n",
    "plot.ts(v, ylim=c(-3,3), main=\"moving average\")"
   ]
