   "source": [
    "### Random Walk with drift\n",
    "\n",
    "#### $x_t = \\delta + x_{t-1} + w_t$ where w_t is white noise. \n",
    "\n",
    "Note that if $\\delta = 0$ then this is just a random walk.\n",
    "\n",
    "#### Notice that $x_t = \\delta t + \\Sigma_{t=1} w_t $\n",
    "\n",
    "Hence $ \\delta $ determines the trend."
   ]
